import "./Line.css";
import "./Lab1EmptyList.css";

function Line(props) {
return (
    <div>
        <span className={"lineSpan"}><input className={"checkboxes"} type={"checkbox"}></input><input className={"textboxes"} type={"text"} value={props.value}></input><br/></span>
    </div>
)
}

export default Line;
